import {
    LOGIN_FAILURE,
    LOGIN_SUCCESS,
    LOGIN_FETCH
} from '../';

export const getUser = (data) => dispatch => {
    dispatch(LOGIN_FETCH)
    fetch("http://127.0.0.1:8000/api/accounts/login/", {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
          // 'Content-Type': 'application/x-www-form-urlencoded',
        },
        body: JSON.stringify(data)
      })
      .then((res)=>{
          console.log(res);
          return res.json();
      })
}
